ResPack *all_respack(const char_t *locale)
{
    ResPack *pack = respack_embedded("all");
    if (str_equ_c(locale, "es_es") == TRUE)
    {
        respack_add_msg(pack, TEXT_FACE_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_PADDING_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_CORNER_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_RADIUS_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_ONE_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_TWO_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_THREE_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_FOUR_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_FIVE_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_SIX_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_TITLE_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_INFO_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_LANG_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_ENGLISH_ES_ES_TEXT);
        respack_add_msg(pack, TEXT_SPANISH_ES_ES_TEXT);
        respack_add_cdata(pack, 1, CARDS_PNG_DATA, CARDS_PNG_SIZE);
        respack_add_cdata(pack, 1, SPAIN_PNG_DATA, SPAIN_PNG_SIZE);
        respack_add_cdata(pack, 1, USA_PNG_DATA, USA_PNG_SIZE);
        return pack;
    }

    /* Non-localized pack */
    {
        unref(locale);
        respack_add_msg(pack, TEXT_FACE_TEXT);
        respack_add_msg(pack, TEXT_PADDING_TEXT);
        respack_add_msg(pack, TEXT_CORNER_TEXT);
        respack_add_msg(pack, TEXT_RADIUS_TEXT);
        respack_add_msg(pack, TEXT_ONE_TEXT);
        respack_add_msg(pack, TEXT_TWO_TEXT);
        respack_add_msg(pack, TEXT_THREE_TEXT);
        respack_add_msg(pack, TEXT_FOUR_TEXT);
        respack_add_msg(pack, TEXT_FIVE_TEXT);
        respack_add_msg(pack, TEXT_SIX_TEXT);
        respack_add_msg(pack, TEXT_TITLE_TEXT);
        respack_add_msg(pack, TEXT_INFO_TEXT);
        respack_add_msg(pack, TEXT_LANG_TEXT);
        respack_add_msg(pack, TEXT_ENGLISH_TEXT);
        respack_add_msg(pack, TEXT_SPANISH_TEXT);
        respack_add_cdata(pack, 1, CARDS_PNG_DATA, CARDS_PNG_SIZE);
        respack_add_cdata(pack, 1, SPAIN_PNG_DATA, SPAIN_PNG_SIZE);
        respack_add_cdata(pack, 1, USA_PNG_DATA, USA_PNG_SIZE);
        return pack;
    }
}
